$(function() {
	$( "#ubicacion" ).autocomplete({
		source: "direcciones.php",
		minLength: 2,
		select: function( event, ui ) {
			$( "#ubicacion" ).val(ui.item.value);
		}
	});
	
	
	
	$("#btnEnviarCOntatcto").click(function (e){
		e.preventDefault();
		$('#id_name, #id_phone, #id_message, #id_email').removeClass('conError');
		var error = 0 ;
		
		if ( $("#id_name").val() == "" )   { error = 1; $('#id_name').addClass('conError'); }
		if ( $("#id_phone").val() == "" )   { error = 1; $('#id_phone').addClass('conError'); }
		if ( $("#id_message").val() == "" )   { error = 1; $('#id_message').addClass('conError'); }
		if ( !validateEmail($("#id_email").val()))   { error = 1; $('#id_email').addClass('conError'); }
		
		if(error==0) {
			
			var datos = {};
			datos.accion = "sendMessageE";
			datos.name = $('#id_name').val();
			datos.phone = $('#id_phone').val();
			datos.email = $('#id_email').val();
			datos.subject = $('#id_subject').val();
			datos.message = $('#id_message').val();
			
			$.ajax({
				type: 'POST',
				dataType: 'json',
				url: '/ajax/godoyAPI.php',
				data: datos,
				success: function (data) {
					if(data.res) {
						$('.contact-form').addClass('success');
					} else {
						alert(data.message);
					}
				}
			});
		} else {
			alert("Completa lso campos");
		}
	});
});

function validateEmail(email) {
    const re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    return re.test(String(email).toLowerCase());
}
